import React from "react";
import home from "./Home.module.css"
import HomePage from "./HomePage/HomePage";

const Home = (props) => {
    const listTo = [
        {id: "viktor", name: "Viktor"},
        {id: "stepan", name: "Stepan"},
        {id: "oleg", name: "Oleg"},
        {id: "greta", name: "Greta"},
    ]
    const linkDataNew = listTo.map(user => <HomePage id={user.id} name={user.name}/>)

    return (
        <div className={home.home}>
            {linkDataNew}
        </div>
    )
}

export default Home
